import './App.css';
import SideBar from './Sidebar';
import NavBar from './Navbar';
import TradingViewWidget, { Themes } from 'react-tradingview-widget';

const data = [
  {market: "BTCUSDC", time: 'Sun, 31 Jul', price: "43,935.23", amount:'0.00351', side:'SELL', status:'CANCEL', color1:'red', color2:'red'},
  {market: "BTCUSDC", time: 'Sun, 31 Jul', price: "43,935.23", amount:'0.00351', side:'BUY', status:'DONE', color1:'green', color2:'green'},
  {market: "BTCUSDC", time: 'Sun, 31 Jul', price: "43,935.23", amount:'0.00351', side:'BUY', status:'CANCEL', color1:'green', color2:'red'},
  {market: "BTCUSDC", time: 'Sun, 31 Jul', price: "43,935.23", amount:'0.00351', side:'BUY', status:'CANCEL', color1:'green', color2:'red'}, ,

]

function App() {
  return (
   <div>
  <SideBar />
  <NavBar />
  <div style={{ paddingLeft:100, display: "flex"}}>
    <div style={{width: 700, height:'100%'}}>
      <TradingViewWidget
        symbol="NASDAQ:AAPL"
        theme={Themes.DARK}
        width="700"
        height="400"
        />
      <div>
      <table style={{border: '1px solid gray', width: 700, height: 300}}>
        <tr>
          <th>MARKET</th>
          <th>TIME</th>
          <th>PRICE</th>
          <th>AMOUNT</th>
          <th>SIDE</th>
          <th>STATUS</th>
        </tr>
        {data.map((val, key) => {
          return (
            <tr key={key}>
              <td>{val.market}</td>
              <td>{val.time}</td>
              <td>{val.price}</td>
              <td>{val.amount}</td>
              <td>{val.side}</td>
              <td>{val.status}</td>
            </tr>
          )
        })}
      </table>
      </div>
    </div>
    <div>Column 2</div>
    <div>Column 3</div>
  </div>

   </div>
  );
}

export default App;
